import React from "react";
// import Play from "./components/play";

class Users extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      nameOne: "",
      nameTwo: "",
      selectX: "",
      selectO: "",
    };
    this.selectSymbol = this.selectSymbol.bind(this);
    this.shouPlay = this.shouPlay.bind(this);
  }
  render() {
    return (
      <div>
        <div id="InputForm">
          <form>
            <input
              id="nameOne"
              type="text"
              placeholder="Your name"
              onChange={(e) => this.setState({ nameOne: e.target.value })}
            />
            <input
              id="selectX"
              type="button"
              value="X"
              onClick={this.selectSymbol}
            />
            <input
              id="selectO"
              type="button"
              value="O"
              onClick={this.selectSymbol}
            />
            <br />
            <br />
            <input
              id="nameTwo"
              type="text"
              placeholder="Your name"
              onChange={(e) => this.setState({ nameTwo: e.target.value })}
            />
            <input
              id="selectX"
              type="button"
              value="X"
              onClick={this.selectSymbol}
            />
            <input
              id="selectO"
              type="button"
              value="O"
              onClick={this.selectSymbol}
            />
            <br />
            <br />
          </form>
        </div>
        <div>
          <button id="start" onClick={this.shouPlay}>
            START
          </button>
        </div>
      </div>
    );
  }
  shouPlay = () => {};
  selectSymbol = (el) => {};
}
export default Users;
